import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <a
          className="App-link"
          href="https://www.etymonline.com/word/peripatetic"
          target="_blank"
          rel="noopener noreferrer"
        >
          <i><p>Peripatetik:</p></i>
        </a>
        <p>"a disciple of Aristotle, one of the set of philosophers who followed the teachings of Aristotle"</p>
      </header>
    </div>
  );
}

export default App;
